// Juice Images
const immunityBoosterImg = require('./immunity-booster.png').default;

// Image metadata
export const juiceImages = {
  immunityBooster: {
    src: immunityBoosterImg,
    alt: 'Immunity Booster Juice',
    description: 'Orange, Carrot, and Ginger blend',
    price: '$5.99',
    ingredients: ['Orange', 'Ginger', 'Carrot', 'Mint leaves'],
    benefits: [
      'Boosts immune system',
      'Rich in Vitamin C',
      'Anti-inflammatory properties',
      'Improves digestion'
    ]
  }
};
